import React, {FC, ReactChild, ReactNode} from 'react';

export interface GameDivProps {
    children?: ReactChild | ReactNode
}

const GameDiv: FC<GameDivProps> = ({children}) => {
    return (
        <div
            style={{
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                width: '100%',
                height: '100%',
                top: '0',
                left: '0',
                position: 'fixed'
            }}
        >
            {children}
        </div>
    );
};

export default GameDiv;
